<style>

        margin: 0;
        padding: 0;
    }

    .container{
        position: relative;
        width :100%;
        height: 100%;
        display: block;
        margin-top: 0;
        margin-left: 0;
    }

    .default_icon{
        display: block;

        width: 100%;

        width: 100%;
        height: 100%;
        display: none;
        margin-top: 0%;
        margin-left: 0%;
    }


    .container:hover .default_icon{
        display: none;
    }

    .container:hover .hover_icon{
        display: block;
    }


</style>
